"use strict";
/**
 * Arrow Functions
 */
/**
 * Regular old way function
 */
var anAddFunction = function (n1, n2) {
    return n1 + n2;
};
// Arrow function 
var anAddArrow = function (n1, n2) {
    return n1 + n2;
};
var res1 = anAddFunction(1, 1);
var res2 = anAddArrow(2, 2);
